from sklearn import treefrom sklearn import ensemblefrom sklearn import linear_modelmodels = {    "decision_tree_gini": tree.DecisionTreeClassifier(criterion="gini"),    "decision_tree_entropy": tree.DecisionTreeClassifier(criterion="entropy"),    "rf": ensemble.RandomForestClassifier(),    # Max iterations increased to mask issue of inability to converge in first 100 iterations:    # https://stackoverflow.com/questions/52670012/convergencewarning-liblinear-failed-to-converge-increase-the-number-of-iterati    "logres" : linear_model.LogisticRegression(max_iter=1000)}